import ServicesList from "./ServicesList";
import services_data from "./Data";
import classes from './Services.module.css'


function Services(){
    return (
        <section>
            <h1 className={classes.header}>
                All Services
            </h1>
            <ServicesList meetups={services_data}/>
        </section>

    );
}

export default Services;
